import logo from './logo.svg';
import './App.css';
import { Route, Routes } from "react-router-dom";
import Search from "./Search"
import Homes from "./Homes"
function App() {
  return (
    <div >
     <Routes>
       <Route path="/anand" element={<Search />} />


       <Route path={"/"} element={<Homes/>} />
       </Routes>




    </div>
  );
}

export default App;
